import React from 'react';

function Footer() {
    return (
        <header>
            <a href="https://github.com/jacobmca"><i className="fa-brands fa-github"></i></a>
            <a href="https://www.linkedin.com/in/jacob-mcauliffe-5340b641/"><i className="fa-brands fa-linkedin"></i></a>
            <a href="https://www.youtube.com/channel/UCBezQ45HXl20AC5FLeecCAw"><i className="fa-brands fa-youtube"></i></a>
        </header>
    )
}

export default Footer;
